import { Component, OnInit } from '@angular/core';
import { HttpService } from './http.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit{
  title = 'reynodance-academy';

  data: string = '';

  constructor(private http: HttpService){}

  ngOnInit(): void {
    this.http.getData().subscribe(response => {
    this.data = response; //store the response from the backend into the data variable
    })
  }
}
<app-navbar></app-navbar>
<div>
    <h1>Response from Spring Boot API:</h1>
    <p>{{ data }}</p>  <!-- This will display the data -->
</div>
